  public static int lengthOfLongestSubstring(String s) {
    List<Character> list = new ArrayList<>();
    char c;
    int max = 0;
    for (int i = 0; i < s.length(); i++) {
      c = s.charAt(i);
      if (list.contains(c)) {
        max = Math.max(max, list.size());
        while (list.get(0) != c)
          list.remove(0);
        list.remove(0);
      }
      list.add(c);
    }
    return Math.max(max, list.size());
  }
